import React from "react";

const VideoList = (props) => {
  return (
      <div className="item">
        <div className="ui tiny image">
          <img alt="alt" src={props.url} />
        </div>
        <div className="middle aligned content">
          <a href="/" className="header">
            {props.title}
          </a>
        </div>
      </div>
  );
};

export default VideoList;
